import ContactFooter from './HomeComponents/ContactFooter';

const ContactPage =()=>{
    return (
        <>
        <main className="ali">
            <h1>Contact Us</h1>
            <br />
            <p>
                You can contact me through <a 
                href='https://www.linkedin.com/in/ali-khaled-130013/' 
                target="_blank"
                rel="noreferrer"
                >LinkedIn </a>
                <br/>
                or by sending me an email <br />
                or directly message me via telegram 
            </p>
            
        </main>
        <ContactFooter />
        </>
    );
}
export default ContactPage;
